var b="url",c="拼团详情页.html",d="generationDate",e=new Date(1574929666413.67),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="18ab1ab352bb4660bb621af26778aaaa",u="type",v="Axure:Page",w="拼团详情页",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="e7d5c8a935c5410d812a522b6d665325",D="label",E="有2人正在拼团，快速参团",F="说明",G="<p><span>若配置的商品仅新用户参团则显示“</span><span style=\"font-family:'华文细黑';color:#333333;\">有X人正在拼团，快速参团（仅限新用户）”</span></p><p><span style=\"font-family:'华文细黑';color:#333333;\"><br></span></p><p><span style=\"font-family:'华文细黑';color:#333333;\">若有X个团在拼团，则显示N人，超过2人列表进行轮播显示（5秒往上移，隐藏一个再显示一个） 轮播全部，优先显示开团最早的团单</span></p>",H="2",I="9627bb62a7d74bde9bbd594af80a96cd",J="(内联框架)",K="<p><span>若后台上传视频，则视频显示在第一张。</span></p><p><span><br></span></p><p><span>用户在wifi情况下，进入详情页自动播放</span></p><p><span>播放时默认关闭声音（可打开和关闭声音），下方显示播放进度条，播放一遍结束后停止自动播放</span></p><p><span><br></span></p><p><span>用户在4G情况下，不自动播放，视频暂停状态</span></p><p><span><br></span></p><p><span>向右滑动可查看商品图片，和视频可以左右滑动切换</span></p>",L="3",M="485b2ddf68e54a36a443e5c99082e3c4",N="(矩形)",O="<p><span>拼团活动开始期间显示该拼团活动条</span></p><p><span>若拼团活动结束或拼团活动未开始，则显示普通商品详情页</span></p><p><span><br></span></p><p><span>若商品在活动期间下架该商品下架</span></p>",P="4",Q="4a7f4d89ace1461cb30abea7122d9bd3",R="￥899",S="<p><span>拼团价</span></p>",T="5",U="13a5ec236a6c4c46afd9eb6cb692dc4c",V="2人团",W="<p><span>后台配置的成团人数</span></p>",X="6",Y="be3b71387c144e1f8167863f36830bbb",Z="￥1899",ba="<p><span>参考价</span></p>",bb="7",bc="9f98ec6d8822455fb8317612daac4142",bd="距结束还剩 1天12:32:23",be="<p><span>商品拼团活动倒计时，精确到秒进行倒数，倒数结束页面恢复普通购买页。</span></p>",bf="8",bg="52a41616e4bb486185d58a822957f497",bh="<p><span>会员，金卡下单可省{售价-会员价}，到手价{会员价}</span></p><p><span><br></span></p><p><span>点击去开通，跳转会员页</span></p><p><span><br></span></p><p><span><br></span></p>",bi="9",bj="611b8760e2fd42b2b815f88764738c84",bk="<p><span>普通商品和拼团商品会员内容显示一 致</span></p>",bl="10",bm="f29086308f3f47dbbb8b6eaf16b0fc4d",bn="说明：",bo="<p><span>全场包邮改为“限时全场包邮“</span></p><p><span>”正品保证“改为”{品牌名}发货“</span></p>",bp="11",bq="45c6de5cccd24d639548a862f5ecd3bf",br="<p><span>正品保证模块，点击跳转正品保障详情页</span></p>",bs="12",bt="4d993ca09d644e4d8afb4176eabee5e1",bu="(动态面板)",bv="<p><span>最多显示5个，超出显示”查看更多“</span></p><p><span>不足5个不显示查看更多，若&gt;=5个有多少个显示多少</span></p><p><span>产品显示对应该 品牌下的商品，按销量倒序显示（无销量按商品上架时间倒序排列）最新上架的显示在最前面</span></p><p><span><br></span></p><p><span><br></span></p>",bw="13",bx="0b596f25840443bab1f4a9d09bc4cad2",by="已售10.9万",bz="<p><span>每个商品默认显示</span></p><p><span>（5000-30000 初始值随机取一个，后面再按浏览量进行增加），1万以前显示9999，1万以上显示 ”1.9万“、”133万“</span></p><p><span><br></span></p><p><span>例：A商品初始值随机取到了5000</span></p><p><span>B商品初始值随机取到了7010</span></p><p><span>，后续浏览商品 A 2次/人 B 3次/人，则计已售A商品5002，B商品已售7013</span></p><p><span><br></span></p><p><span><br></span></p>",bA="14",bB="30eae9731cb34dc59ba1717cac8a4028",bC="X  喜欢的好物快分享给好友",bD="<p><span>进入详情页在顶部展示该提示</span></p><p><span><br></span></p><p><span>页面滑动时不消失 ，页面停留10s后消失 </span></p><p><span>点击X时消失、点击...时消失 （仅在首次进入小程序时显示）</span></p>",bE="15",bF="699fd482ef5946ad8dbb8613265c640d",bG="<p><span>参团活动商品，单独购买为售价。单独购买跳转确认订单页支付成功后不参团，同普通商品“立即购买”按钮</span></p>",bH="16",bI="1161f17bdde94d3595e8b990a0b1bda9",bJ="<p><span>我要开团价格为拼团价。</span></p><p><span><br></span></p><p><span>1、开团判断库存情况</span></p><p><span>2、</span></p><p><span>3、</span></p>",bK="17",bL="94e0285d62da42e0b7d7df211021155d",bM="<p><span>已开通会员用户 单独购买按钮变色且为“会员免拼”，价格为会员价</span></p>",bN="18",bO="5b16528f811349c0abf500286d1e41a9",bP="去参团",bQ="<p><span>单规格商品，无需选择规格直接跳转确认订单页“</span></p>",bR="19",bS="85771380940944a89e6489e991b6d646",bT="每人限拼1件",bU="<p><span>根据后台配置每人限购件数进行显示</span></p><p><span>每人限拼{x}件，不显示仅剩n件</span></p><p><span><br></span></p><p><span>在加减时按普通商品进行库存和限购判断</span></p><p><span><br></span></p><p><span>判断优先级：库存---每人限拼件数</span></p><p><span><br></span></p><p><span>若输入的件数、点击+数量 &gt;库存 提示“库存不足了”&nbsp; +置灰</span></p><p><span>若输入的件数、点击+数量&lt;库存大于限购提示“该商品最多购买X件” +置灰</span></p><p><span><br></span></p>",bV="style",b